import React, { lazy, Suspense } from "react";
import { Switch, Route } from "react-router-dom";
import Navigation from "./navigation/navigation";
// import HomePage from "./homepage/HomePage";
// import MoviesPage from "./movies/MoviesPage";
// import MovieDetailPage from "./movieDetailPage/MovieDetailPage";
const HomePage = lazy(() => import("../homapage/HomePage"));
const MoviesPage = lazy(() => import("../movies/MoviesPage"));
const MovieDetailPage = lazy(() =>
  import("../movieDetailPage/MovieDetailPage")
);

function App() {
  return (
    <div>
      <Navigation />
      <Suspense fallback={<p>dfsdfsd</p>}>
        <Switch>
          <Route path="/" exact component={HomePage} />
          <Route path="/movies/:movieId" component={MovieDetailPage} />
          <Route path="/movies" component={MoviesPage} />
        </Switch>
      </Suspense>
    </div>
  );
}

export default App;
